package main

func factorial(n int) int {
	if n == 0 {
		return 1
	}
	result := 1
	for i := 1; i <= n; i++ {
		result *= i
	}
	return result
}

func SpecialFactorial(n int) int {
	if n <= 0 {
		return 0
	}
	result := 1
	for i := 1; i <= n; i++ {
		result *= factorial(i)
	}
	return result
}
